  false,\n\t\"url\": null,\n\t\"notes\": \"As part of Rapid Ecological Assessments
  (REA), Twelve quadrats were sampled along 2 consecutively-placed, 25m transect lines,
  conducted at 9 sites at Guam in the Marianas Archipelago from 3 - 9 October 2005,
  aboard the NOAA ship Oscar Elton Sette, during the Reef Assessment and Monitoring
  Program (RAMP) Cruise OES0512. Raw survey data included genus presence and relative
  abundance, and voucher specimens. Detailed taxonomic analyses of voucher specimens
  are presented.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
